import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id}){

    const q = () => {
        getQuestionId(id);
    };

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{qt.title}</p>


        </Paper>
    )
}

export default Question;
